import React from "react";

const cat1 = require('../images/alimentacao.png');
const cat2 = require('../images/tecnologia.png');
const cat3 = require('../images/cat3.jpg');
const cat4 = require('../images/cat4.jpg');
const cat5 = require('../images/cat5.jpg');

function Home() {
    return (
    <div className="container">

        
            <div className="row">
                <div className="col-md-8">ALIMENTAÇÃO
                    <div className="card" style={{width: "18rem"}}>
                    <img src={cat1} className="card-img-top" alt="..."/>
                    </div>
                </div>
                <div className="col-6 col-md-4">TECNOLOGIA</div>
                    <div className="card" style={{width: "18rem"}}>
                    <img src={cat2} className="card-img-top" alt="..."/>
                    </div>
            </div>

            <div className="row">
                <div className="col-6 col-md-4">VESTUÁRIO</div>
                <div className="col-6 col-md-4">CASA</div>
                <div className="col-6 col-md-4">ANIMAIS</div>
            </div>


            <div className="row">
                <div className="col-6">DESPORTO</div>
                <div className="col-6">JARDIM</div>
            </div>
    </div>
        
    );
}

export default Home;
